import React from "react";
import Logo from "../images/logo.svg";

const HelloWorld = () => {
  return (
    <nav>
      <img src={Logo} alt="Logo" />

      <ul>
        <li>Home</li>
      </ul>
    </nav>
  );
};

export default HelloWorld;
